import { Component, OnInit } from '@angular/core';
import { UserService } from '../../services/user.service';
import { Router } from '@angular/router';
import Swal from 'sweetalert2';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html'
})
export class HeaderComponent implements OnInit {

  user:any;
  userToken = window.localStorage.getItem('tokenuser');
  clickNotif = false;
  clickProfil = false;
  private seeProfilAppele = false;


  constructor(private userService: UserService, private router: Router) { }

  ngOnInit(): void {
      this.seeProfil();
  }

  toggleNotif() {
    this.clickNotif = !this.clickNotif;
  }
  toggleProfil() {
    this.clickProfil = !this.clickProfil;
  }

  async seeProfil() {
    try {
      const userToken = window.localStorage.getItem('tokenuser');
      this.user = await this.userService.seeProfil(userToken);

      if (this.user.status === "401") {
        // Swal.fire({
        //   title: 'Oops',
        //   text: this.user.message,
        //   icon: 'error',
        //   width: '600px',
        //   confirmButtonText: 'Ok',
        //   confirmButtonColor: '#FFB0B0',
        // }).then((result) => {});

     //   this.router.navigate(['/']);
      }
    } catch (error) {
      console.error('Erreur lors de la récupération du profil :', error);
    }
  }

  goAccueil() {
    const token = window.localStorage.getItem('tokenuser');
   if( token == null ){
    this.router.navigate(['/']);
   } else{
    this.router.navigate(['/accueil']);
   }
  }

  logout() {

    localStorage.removeItem('tokenuser');
    this.router.navigate(['/']);
  }



}
<div>
    <div class="th-menu-wrapper" >
        <div class="th-menu-area">
            <div class="mobile-logo"><a href="index.html"><img src="assets/img/logo.svg" alt="Rasm"></a>
                <div class="close-menu"><button class="th-menu-toggle"><i class="fal fa-times"></i></button></div>
            </div>
            <div class="th-mobile-menu">
                <ul>
                    <li class="menu-item-has-children"><a href="#">Accueil</a></li>
                    <li class="menu-item-has-children"><a href="#">Services</a></li>
                    <li><a href="contact.html">A propos</a></li>
                    <li class="menu-item-has-children"><a href="index.html">Mon compte</a>
                        <ul class="sub-menu">
                            <li class="menu-item-has-children"><a href="#">Rendez-vous</a>
                                <ul class="sub-menu">
                                    <li><a href="index.html">Prendre</a></li>
                                    <li><a href="home-nail-stylist.html">Historique </a></li>
                                </ul>
                            </li>
                            <li class="menu-item-has-children"><a href="#">Préférences</a>
                                <ul class="sub-menu">
                                    <li><a href="index-2-onepage.html">Consulter</a></li>
                                </ul>
                            </li>
                        </ul>
                    </li>
                </ul>
            </div>
        </div>
    </div>


    <header class="th-header header-layout1 onepage-nav">
        <div class="header-top">
            <div class="container th-container">
                <div class="row justify-content-end justify-content-lg-between align-items-center gy-2">
                    <div class="col-auto d-none d-lg-block">
                        <div class="header-links">
                            <ul>
                                <li><i class="far fa-envelope"></i><a >m1p11mean-Vanya-Liantsoa</a></li>
                                <li><i class="far fa-phone"></i><a href="tel:+256214203215">+256 214 203 215</a></li>

                            </ul>
                        </div>
                    </div>
                    <div class="col-auto">
                        <div class="social-links"><span class="social-title">Par: m1p11mean-Vanya-Liantsoa</span></div>
                    </div>
                </div>
            </div>
        </div>

        <div class="sticky-wrapper">
            <div class="menu-area">
                <div class="container th-container">
                    <div class="row align-items-center justify-content-between">
                        <div class="col-auto">
                            <div class="header-logo"><a><img src="assets/img/logo.svg" alt="Rasm"></a>
                            </div>
                        </div>
                        <div class="col-auto me-xl-auto">
                            <nav class="main-menu d-none d-lg-inline-block">
                                <ul>
                                    <li><a (click) = "goAccueil()">Accueil</a></li>
                                    <li><a href="#contact-sec">A propos</a></li>
                                    <li class="menu-item-has-children"><a href="index.html">Mon compte</a>
                                        <ul class="sub-menu">
                                            <li class="menu-item-has-children"><a href="#">Rendez-vous</a>
                                                <ul class="sub-menu">
                                                    <li><a [routerLink]="['/rdv']">Historique </a></li>
                                                </ul>
                                            </li>
                                            <li class="menu-item-has-children"><a href="#">Préférences</a>
                                                <ul class="sub-menu">
                                                    <li><a [routerLink]="['/preferrence']">Liste</a></li>
                                                </ul>
                                            </li>
                                        </ul>
                                    </li>
                                </ul>
                            </nav>
                            <button class="th-menu-toggle d-inline-block d-lg-none"><i class="far fa-bars"></i></button>
                        </div>
                        <div class="col-auto d-none d-xl-block">
                            <div class="header-button" >
                                
                                <app-notification-list></app-notification-list>

                                <a (click) = "seeProfil()" class="icon-btn sideMenuToggler">
                                    <i class="fa-light fa-user"></i>
                                    <div class="col-md-12 col-lg-12 col-xl-12" class="sub-menu" *ngIf="clickProfil">
                                      <div class="widget woocommerce widget_shopping_cart" style="width: 300px; position: relative; right: 200px; background-color: white;">
                                          <h5 class="widget_title">Menu</h5>
                                          <div class="widget_shopping_cart_content">
                                              <ul class="woocommerce-mini-cart cart_list product_list_widget">
                                                  <li>
                                                      <p ><a (click)="logout()">Se déconnecter </a></p>
                                                  </li><hr class="style1">

                                              </ul>
                                          </div>
                                      </div>
                                  </div>
                                </a>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="logo-bg"></div>
            </div>
        </div>
    </header>
</div>
